INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (4, 110501, 24, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 24015, "カオリ（サマー）", 0.0, 1, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", 10021, 4, 0.0, 0.0);
INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (4, 110501, 24, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 24016, "カオリ（サマー）", 0.0, 2, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", 10021, 1, 0.0, 4.0);
INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (4, 110501, 24, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 24017, "カオリ（サマー）", 0.0, 3, "マジムンだらけで目が回るさ～！\nふらふらさ～！", 10021, 4, 0.0, 0.0);
INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (1, 110501, 24, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 24018, "カオリ（サマー）", 0.0, 4, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", 10021, 2, 0.0, 5.2);
INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (5, 110501, 24, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 24019, "カオリ（サマー）", 0.0, 5, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", 10021, 6, 0.0, 4.2);
INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (2, 110501, 24, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 24020, "カオリ（サマー）", 0.0, 6, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", 10021, 2, 0.0, 0.0);
INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (1, 110501, 24, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 24021, "カオリ（サマー）", 0.0, 7, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", 10021, 6, 0.0, 6.4);
INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (2, 110501, 24, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 24022, "カオリ（サマー）", 0.0, 8, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", 10021, 2, 0.0, 0.0);
INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (6, 110501, 24, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 24023, "カオリ（サマー）", 0.0, 9, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", 10021, 3, 0.0, 10.08);
INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (1, 110501, 24, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 24024, "カオリ（サマー）", 0.0, 10, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", 10021, 2, 0.0, 5.0);
INSERT INTO `v1_1369b0e972db4af8a9cce6177ca011bac10d9c4b81a704b4d28c92e018d68cb8` VALUES (2, 110501, 24, "2019/07/31 12:00:00", "2030/12/17 14:59:59", 24025, "カオリ（サマー）", 0.0, 11, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", 10021, 2, 0.0, 0.0);
